import React, { useState, useEffect } from 'react';
import './ResumeReviewHistory.css';
import axios from 'axios';

function ResumeReviewHistory({ onBack }) {
    const [loading, setLoading] = useState(true);
    const [resumeHistory, setResumeHistory] = useState([]);
    const [selectedResume, setSelectedResume] = useState(null);
    const [error, setError] = useState(null);

    // Ëé∑ÂèñÁÆÄÂéÜ‰øÆÊîπÂéÜÂè≤
    useEffect(() => {
        const fetchResumeHistory = async () => {
            try {
                setLoading(true);
                console.log('ÂºÄÂßãËØ∑Ê±ÇÂéÜÂè≤Êï∞ÊçÆ...');
                const response = await axios.get('http://localhost:8080/api/resume/page', {
                    timeout: 10000, // ËÆæÁΩÆË∂ÖÊó∂Êó∂Èó¥
                    headers: {
                        'Content-Type': 'application/json',
                        'Accept': 'application/json'
                    }
                });
                console.log('Êî∂Âà∞ÂìçÂ∫î:', response);
                if (response.data && response.data.success) {
                    const records = response.data.data.records || [];
                    console.log('Ëß£ÊûêËÆ∞ÂΩï:', records);
                    setResumeHistory(records);
                } else {
                    console.error('APIËøîÂõûÈîôËØØ:', response.data);
                    setError(`Ëé∑ÂèñÂéÜÂè≤ËÆ∞ÂΩïÂ§±Ë¥•: ${response.data?.message || 'Êú™Áü•ÈîôËØØ'}`);
                }
            } catch (err) {
                console.error('Ëé∑ÂèñÁÆÄÂéÜÂéÜÂè≤Âá∫ÈîôËØ¶ÊÉÖ:', err.message, err.response || 'Êó†ÂìçÂ∫î');
                if (err.code === 'ECONNABORTED') {
                    setError('ËØ∑Ê±ÇË∂ÖÊó∂ÔºåËØ∑Ê£ÄÊü•ÂêéÁ´ØÊúçÂä°ÊòØÂê¶ÂêØÂä®');
                } else {
                    setError('Êó†Ê≥ïËøûÊé•Âà∞ÊúçÂä°Âô®ÔºåËØ∑Á®çÂêéÂÜçËØï');
                }
            } finally {
                setLoading(false);
            }
        };

        fetchResumeHistory();
    }, []);

    // Êü•ÁúãËØ¶ÊÉÖ
    const viewResumeDetail = async (id) => {
        try {
            setLoading(true);
            console.log(`ÂºÄÂßãËØ∑Ê±ÇID‰∏∫${id}ÁöÑÁÆÄÂéÜËØ¶ÊÉÖ...`);
            const response = await axios.get(`http://localhost:8080/api/resume/${id}`, {
                timeout: 10000,
                headers: {
                    'Content-Type': 'application/json',
                    'Accept': 'application/json'
                }
            });
            console.log('Êî∂Âà∞ËØ¶ÊÉÖÂìçÂ∫î:', response);
            if (response.data && response.data.success) {
                setSelectedResume(response.data.data);
                console.log('ËÆæÁΩÆÈÄâ‰∏≠ÁöÑÁÆÄÂéÜ:', response.data.data);
            } else {
                console.error('APIËøîÂõûËØ¶ÊÉÖÈîôËØØ:', response.data);
                setError(`Ëé∑ÂèñÁÆÄÂéÜËØ¶ÊÉÖÂ§±Ë¥•: ${response.data?.message || 'Êú™Áü•ÈîôËØØ'}`);
            }
        } catch (err) {
            console.error('Ëé∑ÂèñÁÆÄÂéÜËØ¶ÊÉÖÂá∫Èîô:', err.message, err.response || 'Êó†ÂìçÂ∫î');
            setError('Êó†Ê≥ïËé∑ÂèñÁÆÄÂéÜËØ¶ÊÉÖÔºåËØ∑Á®çÂêéÂÜçËØï');
        } finally {
            setLoading(false);
        }
    };

    // ËøîÂõûÂàóË°®
    const backToList = () => {
        setSelectedResume(null);
        setError(null);
    };

    // Ê†ºÂºèÂåñÊó•Êúü
    const formatDate = (dateString) => {
        if (!dateString) return '';
        const date = new Date(dateString);
        return `${date.getFullYear()}-${(date.getMonth() + 1).toString().padStart(2, '0')}-${date.getDate().toString().padStart(2, '0')} ${date.getHours().toString().padStart(2, '0')}:${date.getMinutes().toString().padStart(2, '0')}`;
    };

    // ÈáçËØïÂä†ËΩΩÊï∞ÊçÆ
    const retryLoading = () => {
        setError(null);
        setLoading(true);
        // ‰ΩøÁî®setTimeoutÁ°Æ‰øùÁä∂ÊÄÅÊõ¥Êñ∞ÂêéÂÜçÈáçËØï
        setTimeout(() => {
            const fetchResumeHistory = async () => {
                try {
                    console.log('ÈáçÊñ∞Â∞ùËØïËØ∑Ê±ÇÊï∞ÊçÆ...');
                    const response = await axios.get('http://localhost:8080/api/resume/page', {
                        timeout: 10000,
                        headers: {
                            'Content-Type': 'application/json',
                            'Accept': 'application/json'
                        }
                    });
                    if (response.data && response.data.success) {
                        const records = response.data.data.records || [];
                        setResumeHistory(records);
                    } else {
                        setError(`Ëé∑ÂèñÂéÜÂè≤ËÆ∞ÂΩïÂ§±Ë¥•: ${response.data?.message || 'Êú™Áü•ÈîôËØØ'}`);
                    }
                } catch (err) {
                    console.error('ÈáçËØïËé∑ÂèñÁÆÄÂéÜÂéÜÂè≤Âá∫Èîô:', err);
                    setError('ÈáçËØïÂ§±Ë¥•ÔºåÊó†Ê≥ïËøûÊé•Âà∞ÊúçÂä°Âô®');
                } finally {
                    setLoading(false);
                }
            };
            fetchResumeHistory();
        }, 100);
    };

    return (
        <div className="resume-history">
            <div className="dialog-container">
                <div className="dialog-box">
                    <h2>ÁÆÄÂéÜ‰øÆÊîπÂéÜÂè≤</h2>

                    {loading ? (
                        <div className="loading">Âä†ËΩΩ‰∏≠...</div>
                    ) : error ? (
                        <div className="error-container">
                            <div className="error-message">{error}</div>
                            <button className="retry-button" onClick={retryLoading}>ÈáçËØï</button>
                        </div>
                    ) : selectedResume ? (
                        // ÁÆÄÂéÜËØ¶ÊÉÖËßÜÂõæ
